import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [users, setUsers] = useState([]);
  const [stores, setStores] = useState([]);
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    // Fetch users
    axios.get('http://10.81.85.73:5000/api/admin/users')
      .then(res => setUsers(res.data.users))
      .catch(err => console.log(err));

    // Fetch stores
    axios.get('http://10.81.85.73:5000/api/admin/stores')
      .then(res => setStores(res.data.stores || []))
      .catch(err => console.log(err));

    // Fetch orders
    axios.get('http://10.81.85.73:5000/api/admin/orders')
      .then(res => setOrders(res.data.orders || []))
      .catch(err => console.log(err));
  }, []);

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial' }}>
      <h1>Admin Panel</h1>

      <h2>Users</h2>
      <ul>
        {users.map(user => (
          <li key={user.id}>{user.name} - {user.role}</li>
        ))}
      </ul>

      <h2>Stores</h2>
      <ul>
        {stores.map(store => (
          <li key={store.id}>{store.name} - {store.location}</li>
        ))}
      </ul>

      <h2>Orders</h2>
      <ul>
        {orders.map(order => (
          <li key={order.id}>{order.product} x{order.quantity} - {order.status}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
